import React, { Component } from 'react';

class FetchData extends Component {
    constructor() {
        super();
        this.state = {
            data: [],
        };
    }

    componentDidMount() {
        fetch('https://randomuser.me/api/?results=5')
        .then(response => {
            return response.json();
        }).then(users => {
            this.setState({data: users})
            console.log(users)
        })
    }

    render(){
        return (
            <div>
                "test"
            </div>
        )
    }
}

export default FetchData;
